import React, { useState, useEffect, useRef } from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import { fetchAppData, saveData } from "./api/backendApi";
import LoginForm from "./components/LoginForm";
import UserProfile from "./components/UserProfile";
import Header from "./components/Header";
import HomePage from "./components/HomePage";
import AdminPanel from "./components/AdminPanel";

function App() {
  const [userEmail, setUserEmail] = useState(null);
  const [userData, setUserData] = useState(null);
  const [appData, setAppData] = useState({ 
    users: {}, 
    cards: [],
    allCharacters: [] 
  });
  const [loading, setLoading] = useState(true);

  // Referencia para evitar guardado durante logout
  const isLoggingOut = useRef(false);

  // Cargar todos los datos al iniciar
  useEffect(() => {
    const loadData = async () => {
      try {
        const data = await fetchAppData();
        setAppData({
          users: data.users || {},
          cards: data.cards || [],
          allCharacters: getAllCharacters(data.users)
        });
      } catch (err) {
        console.error("Error loading data:", err);
      } finally {
        setLoading(false);
      }
    };
    loadData();
  }, []);

  // Guardar datos de usuario cuando cambian
  useEffect(() => {
    if (isLoggingOut.current) return;

    if (userEmail && userData) {
      // Función de guardado con retardo para evitar múltiples llamadas
      const saveTimeout = setTimeout(() => {
        saveData("user", { email: userEmail, data: userData })
          .then(() => {
            // Actualizar appData local después de guardar
            setAppData(prev => ({
              ...prev,
              users: {
                ...prev.users,
                [userEmail]: userData
              },
              allCharacters: getAllCharacters({
                ...prev.users,
                [userEmail]: userData
              })
            }));
          })
          .catch(error => {
            console.error("Save error:", error);
            alert("Error al guardar los datos. Intente nuevamente.");
          });
      }, 500);

      return () => clearTimeout(saveTimeout);
    }
  }, [userData, userEmail]);

  // Función para obtener todos los personajes
  const getAllCharacters = (users) => {
    const characters = [];
    Object.entries(users).forEach(([email, userData]) => {
      if (userData.characters) {
        userData.characters.forEach(char => {
          characters.push({
            ...char,
            userEmail: email
          });
        });
      }
    });
    return characters;
  };

  // Guardar tarjetas
  const saveCards = (cards) => {
    saveData("cards", { cards })
      .then(() => setAppData(prev => ({ ...prev, cards })))
      .catch(console.error);
  };

  const handleLogin = async (email, password, mode) => {
    const trimmedEmail = email.trim();
    const existingUser = appData.users[trimmedEmail];

    if (mode === "register") {
      if (existingUser) throw new Error("Usuario ya registrado");

      const newUser = { 
        password, 
        characters: [], 
        labels: [],
        role: "user"
      };

      setUserEmail(trimmedEmail);
      setUserData(newUser);
    } else {
      if (!existingUser || existingUser.password !== password) {
        throw new Error("Credenciales inválidas");
      }
      setUserEmail(trimmedEmail);
    setUserData({
      ...existingUser,
      role: existingUser.role || "user" // Asegurar que tenga rol
    });
  }
};
  const handleLogout = () => {
    // Marcar que estamos en proceso de logout
    isLoggingOut.current = true;

    // Primero: guardar cualquier cambio pendiente de manera síncrona
    if (userEmail && userData) {
      saveData("user", { email: userEmail, data: userData })
        .catch(error => {
          console.error("Final save error:", error);
        });
    }

    // Luego: resetear estados
    setUserEmail(null);
    setUserData(null);

    // Restablecer después de un breve retardo
    setTimeout(() => {
      isLoggingOut.current = false;
    }, 1000);
  };

  // Determinar rol del usuario
  const userRole = userData?.role || "user";

  return (
    <BrowserRouter>
      <Header userEmail={userEmail} onLogout={handleLogout} />
      <Routes>
        <Route path="/" element={<HomePage cards={appData.cards} loading={loading} />} />
        <Route 
          path="/login" 
          element={userEmail ? <Navigate to={userRole === "admin" ? "/admin" : "/profile"} /> : <LoginForm onLogin={handleLogin} />} 
        />
        <Route 
          path="/profile" 
          element={
            userEmail && userRole === "user" ? 
              <UserProfile 
                userEmail={userEmail} 
                userData={userData} 
                setUserData={setUserData} 
              /> : 
              <Navigate to="/login" />
          } 
        />
        <Route 
          path="/admin" 
          element={
            userEmail && userRole === "admin" ? 
              <AdminPanel 
                cards={appData.cards}
                allCharacters={appData.allCharacters}
                onSaveCards={saveCards}
              /> : 
              <Navigate to="/login" />
          } 
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
